  true,\n\t\"url\": null,\n\t\"notes\": \"For emerging energy technologies, a variety
  of cost and performance numbers are cited in presentations and reports for present-day
  characteristics and potential improvements. Amid a variety of sources and methods
  for these data, the Office of Energy Efficiency and Renewable Energyu2019s technology
  development programs determine estimates for use in program planning.rnrnThe Transparent
  Cost Database collects program cost and performance estimates for EERE technologies
  in a public forum where they can be viewed and compared to other published estimates.
  The database includes literature on technology cost, performance estimates and levelized
  costs (both current and future projections) for:rnrn * electricity generationrn
  * biofuelsrn * vehiclesrnAll data are downloadable for full transparency. rnrnLevelized
  cost calculation parameters for all three areas can be adjusted and the dynamic
  results can be downloaded in CSV or as a formatted spreadsheet.rnrnThis project
  is under active development and we welcome user suggestions for additional features
  or modifications to enhance usability for the energy community. The database also
  allows nomination of data sets for inclusion in the database or comments on the
  estimates used by interested users. Please go to the app to nominate publications/data
  set to be included.rnrnDOE-019-8574922225\",\n\t\"license_title\": \"Creative Commons
